// const chromiumPack = "https://github.com/Sparticuz/chromium/releases/download/v121.0.0/chromium-v121.0.0-pack.tar";
const generatePdf = async (htmlContent) => {
  // const browser = await puppeteer.launch({
  //   args: chromium.args,
  //   executablePath: await chromium.executablePath(chromiumPack),
  //   headless: true,
  // });
  const browser = await puppeteer.launch();
  const page = await browser.newPage();

  await page.setContent(htmlContent);
  const pdfBuffer = await page.pdf();

  await browser.close();
  return pdfBuffer;
};

export async function POST(req) {
  const data = await req.json();
  console.log(data)
  if (
    !data ||
    !data?.to_name ||
    !data?.to_email ||
    !data?.phone ||
    !data?.subject ||
    !data?.address ||
    !data?.associatesName ||
    !data?.propertyName ||
    !data?.contractType
  ) {
    return NextResponse.json({ success: false, message: "Data incomplete" });
  }
  const currentDate = getCurrentDate();
  try {
    const emailContent = generateEmailContent(data);
    const pdfBuffer = await generatePdf(emailContent.html);
    const inputData = generateInputFormData(data);
    const pdfBufferForInput = await generatePdf(inputData.html);
    await transporter.sendMail({
      ...mailOptions,
      to: process.env.NEXT_PUBLIC_SENDER_EMAIL,
      subject: data.subject,
      ...generateEmailBody(data),
      attachments: [
        // {
        //   filename: "logo.png",
        //   path: "/public/images/logo.png",
        //   cid: "logo",
        // },
        // {
        //   filename: "dest.jpg",
        //   path: "public/images/dest.jpg",
        //   cid: "place",
        // },
        {
          filename: 'contract.pdf',
          content: pdfBuffer,
        },
        {
          filename: 'input.pdf',
          content: pdfBufferForInput  ,
        },
      ],
    });

    return NextResponse.json({ success: true });
;
  } catch (err) {
    console.log(err);
    return NextResponse.json({ success: false, message: err.message });
  }
}
